import { makeStyles } from "@material-ui/styles";

const useStyles = makeStyles((theme) => ({
  gform: {
    width:"100%",
    height:"1379px",
    frameBorder:"0",
    marginHeight:"0",
    marginWidth:"0",
    '&::-webkit-scrollbar': {
        overflowY:"hidden"
    }
 }
}))

function Form(props) {
  const classes = useStyles();
  return(
    <iframe 
       src={props.location.state.key} 
       className={classes.gform}
    >
       Loadingâ€¦
    </iframe>
  );
}

export default Form;
